from typing import List
from datetime import datetime

# DEFINE SOLUTION IN HERE
class Solution:
    def jump(self, nums: List[int]) -> int:
        if len(nums) == 1:
            return 0
        distance = len(nums) - 1
        min_step = 0
        prev = 0

        for i in range(len(nums)):
            if prev == i:
                min_step += 1
                if nums[i] >= distance:
                    return min_step
                # numbers we can reach from nums[i]
                within_range = nums[i+1:nums[i]+i+1]
                # remaining distance at within_range[i] is distance - i
                distance_from = [distance - i - within_range[i] for i in range(len(within_range))]
                # get the index of the last reachable number
                prev = len(within_range) - distance_from[::-1].index(min(distance_from)) + i
            distance -= 1

        return min_step

if __name__ == '__main__':
    solution = Solution()

